import React from "react";
import "./sidebar.css";

function Sidebar() {
  return (
    <div className="sidebar-wrapper">
      <div className="logo-wrapper"><p>w</p></div>
      <div className="menu-wrapper"><p>w</p></div>
      <div className="download-wrapper"><p>w</p></div>
    </div>
  );
}

export default Sidebar;
